import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl:'app.component.html'

})
export class AppComponent {
  titulo: string = 'Contador App';
  numero: number = 10;
   Sumar(value:number){
    this.numero += value;
  }
}
